    false,nt"url": null,nt"notes": "This annual narrative report for Quivira
    National Wildlife Refuge summarizes refuge activities during the 1993 calendar year.
     The report begins with a summary of the years highlights and climatic conditions.
      Land acquisition is also covered.  The report includes a planning section which
    discusses compliance with environmental and cultural mandates, research and investigations.
     Refuge administration is outlined; information about personnel, youth programs,
    other manpower programs, volunteer programs, funding, safety, technical assistance,
    and other items is given.  Habitat management is also covered.  Subjects include
    general, wetlands, croplands, grasslands, other habitats, grazing, fire management,
    pest control, water rights, wilderness and special areas, and WPA easement monitoring.
     The wildlife section of the report discusses wildlife diversity, endangered andor
    threatened species, waterfowl, marsh and waterbirds, shorebirds, gulls, terns, and
    allied species, raptors, other migratory birds, games animals, other resident wildlife,
    fishery resource, animal control.  The public uses of the refuge described in this
    report include general, outdoor classrooms students, interpretive tour routes, interpretive
    exhibitsdemonstrations, other interpretive programs, hunting, fishing, wildlife
    observation, other wildlife oriented recreation, law enforcement.  The equipment
    and facilities section of the report provides information about new construction,
    rehabilitation, major maintenance, equipment utilization and replacement.  Items
    of interest are provided at the end.",nt"license_title": "License Not Specified",nt"extras":
